import React from 'react';
import './App.css';
import { NeuCard } from 'neumorphic-ui';

function App() {
  return (
    <div>
      <h1>Hello World</h1>
      <NeuCard width="600px" height="300px" >
        <p>Testing inside the card</p>
      </NeuCard>
    </div>
  );
}

export default App;
